function Header() {
    return (
    <nav>
        <img src="../public/favicon.ico" alt="react-logo"></img>
        <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
    );
}

export default Header;
